int Lexico::getToken(string entrada){
    
    char c;
    int posic;
    int token = 0;
    
    while(1){ //percorrendo o token atual
        
        if(i > static_cast<int>(entrada.size()))
			return -1;
		if(i == static_cast<int>(entrada.size())){
			if(ultimoEstadoFinal != 0){ //foi identificado um token até o caractere anterior
                atualizaTokenAnterior(entrada);
				token = codigoToken(ultimoEstadoFinal);
				i++;
			}
			else{
				if(estadoAtual != 1){
					if(c == '\n')
						incrementaLinha();
					else
						incrementaColuna();
					cout << "ERRO LEXICO. Linha: " << linha << " Coluna: " << coluna;
					cout << " -> '" << c << "'";
				}
				exit(1);
			}
			break;
		}
		
		c = entrada[i];

		if((c == '\n' || c == ' ') && estadoAtual == 1){ //espaço em branco
			i++;
			if(c == '\n')
				incrementaLinha();
			else
				incrementaColuna();
			resetaEstados(&i, &inicioToken, &fimToken, &estadoAtual, &ultimoEstadoFinal);
			continue;
		}  
		if((estadoAtual == 141 && c == ' ') || //string
			(c == ' ' && ultimoEstadoFinal == 131) || //comentário de linha
			((c == '\n' || c == ' ') && ultimoEstadoFinal == 171)){ //comentário de bloco
			i++;
			if(c == '\n')
				incrementaLinha();
			else
				incrementaColuna();
			continue;
		}
	
		posic = indiceSimbolo(c);

		if(posic == -1 || c == ' '){ //caractere atual não pertence ao alfabeto
			if(ultimoEstadoFinal != 0){ //foi identificado um token até então
				atualizaTokenAnterior(entrada);
				token = codigoToken(ultimoEstadoFinal);
				resetaEstados(&i, &inicioToken, &fimToken, &estadoAtual, &ultimoEstadoFinal);
				break;
			}
			else{ //erro
				if(c == '\n')
					incrementaLinha();
				else
					incrementaColuna();
				if(c != ' ' && c != '\n'){
					cout << "ERRO LEXICO. Linha: " << linha << " Coluna: " << coluna;
					cout << " -> '" << c << "'";
                    exit(1);
				}
                atualizaTokenAnterior(entrada);
				token = codigoToken(ultimoEstadoFinal);
				i = inicioToken + 1;
				resetaEstados(&i, &inicioToken, &fimToken, &estadoAtual, &ultimoEstadoFinal);
				break;
			}
		}
		else{ //caractere atual pertence ao alfabeto
			estadoAtual = transicoes[estadoAtual][posic]; //calculando novo estado
			if(estadoAtual == 0){ //novo estado é inválido
				if(ultimoEstadoFinal != 0){ //foi identificado um token até o caractere anterior
					atualizaTokenAnterior(entrada);
					token = codigoToken(ultimoEstadoFinal);
					resetaEstados(&i, &inicioToken, &fimToken, &estadoAtual, &ultimoEstadoFinal);
					break;
				}
				else{ //erro
					if(c == '\n')
						incrementaLinha();
					else
						incrementaColuna();
					cout << "ERRO LEXICO. Linha: " << linha << " Coluna: " << coluna;
					cout << " -> '" << c << "'";
					exit(1);
				}
			}
			else{ //novo estado é válido
				if(estadoFinal(estadoAtual)){ //novo estado é final
					fimToken = i;
					ultimoEstadoFinal = estadoAtual;
				}
			}
		}
		if(entrada[i] == '\n')
			incrementaLinha();
		else{
			incrementaColuna();
		}
			
		i++;
    }

    return token;
}

int Lexico::indiceSimbolo(char c){ //retorna o índice que representa o símbolo do alfabeto na matriz de transições

    if(strchr(alfabeto, c) == NULL)
        return -1;                                 //caso o caractere c não pertença ao alfabeto
    
    return (strchr(alfabeto, c) - alfabeto);
}

int Lexico::estadoFinal(int estado){ //retorna 1 se o estado é final e 0 se não é
    for(int i = 0; i < qtdEstadosFinais; i++){
        if(estadosFinais[i] == estado)
            return 1;
    }
    return 0;
}

int Lexico::indiceEstadoFinal(int estado){ //retorna -1 se o estado não é final e sua posição, se é
    for(int i = 0; i < qtdEstadosFinais; i++){
        if(estadosFinais[i] == estado)
            return i;
    }
    return -1;
}

